import React, { useEffect } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { getCategories, getProductsByCategory } from '../../store/reguests'
import s from './AllCategories.module.css'
import { Link } from 'react-router-dom'

export default function AllCategories() {
    const dispatch = useDispatch()
    useEffect(() => dispatch(getCategories), [])

    const categories = useSelector(state => state.categories)
    // const categories_up = categories[0].toUpperCase() + categories.slice(1)

    getProductsByCategory()

  return (
    <div>
        {categories.map(el => <Link to={'/categories/:category'}>
                                  <div key={el} className={s.category_card}>{el}
                                    {/* <img src=`http://localhost:3333 + {el.image}` alt='category' /> */}
                                  </div>
                              </Link>
                        )
        }
    </div>
  )
}
